import React from 'react';
import { Link } from 'react-router-dom'; 

// Simple styles for navigation
const navStyle = {
    backgroundColor: 'green',
    padding: '10px',
  };

  const ulStyle = {
    listStyleType: 'none',
    margin: 0,
    padding: 0,
    overflow: 'hidden',
  };

  const liStyle = {
    display: 'inline',
    marginRight: '10px',
  };


function Dashboard() {
  return (
<div>
    {/* Top Navigation */}
    <nav style={navStyle}>
    <ul style={ulStyle}>
      <li style={liStyle}><Link to="/">Home</Link></li>
      <li style={liStyle}><Link to="/dashboard">Dashboard</Link></li>
      <li style={liStyle}><Link to="/login">Login</Link></li>
    </ul>
  </nav>



      <h1>Dashboard</h1>
      <p>Welcome to the Dashboard. Only logged-in users can see this page.</p>
    </div>
  );
}

export default Dashboard;
